import React from "react";
import Link from "./Link";
// import "./Panel.css"



const Panel = ({ content }) => {
  console.log(content);
  const panelLink = content.map(el => {
    return <Link name = {el.name} url={el.url} key={el.key} />
  });
  console.log(panelLink);
  return <div>
    { panelLink}
  </div>
};

export default Panel;
